import{_ as t,c as s,I as n,j as e,a as p,aS as r,o,D as c}from"./chunks/framework.DdcMEUql.js";const i="data:image/png;base64,",A="/assets/epsonL380.bH-9sTJr.png",d="/assets/epsonL380driver.C0mRQ7kZ.png",l="/assets/epson%E8%BF%9E%E6%8E%A5.D6TGi_BK.png",h="/assets/epson%E6%89%93%E5%8D%B0%E8%AF%86%E5%88%AB.xyO-eYZM.png",m="/assets/epson%E6%89%AB%E6%8F%8F%E8%AF%86%E5%88%AB.Bfq60WQH.png",B=JSON.parse('{"title":"epson爱普生L380打印机使用教程","description":"","frontmatter":{},"headers":[],"relativePath":"note/knowledge/02-epson爱普生L380打印机使用教程.md","filePath":"note/knowledge/02-epson爱普生L380打印机使用教程.md","lastUpdated":1722866911000}'),E={name:"note/knowledge/02-epson爱普生L380打印机使用教程.md"},P=e("h1",{id:"epson爱普生l380打印机使用教程",tabindex:"-1"},[p("epson爱普生L380打印机使用教程 "),e("a",{class:"header-anchor",href:"#epson爱普生l380打印机使用教程","aria-label":'Permalink to "epson爱普生L380打印机使用教程"'},"​")],-1),Q=r('<h2 id="打印机功能" tabindex="-1">打印机功能 <a class="header-anchor" href="#打印机功能" aria-label="Permalink to &quot;打印机功能&quot;">​</a></h2><p>这款打印机功能还是挺齐全的，包含打印和复印。支持黑白和彩色</p><h2 id="功能按键" tabindex="-1">功能按键 <a class="header-anchor" href="#功能按键" aria-label="Permalink to &quot;功能按键&quot;">​</a></h2><p><img src="'+i+'" alt=""></p><p>从左至右的意思分别是：</p><p>按钮1：开启或关闭打印机。（按一下是开机，长按是关机）</p><p>说明：电源灯闪烁时，代表打印机正在工作或处理数据，此时不能关闭打印机，直至指示灯熄灭。</p><p>按钮2：在A4尺寸的普通纸上开始单色复印。</p><p>说明：要增加复印份数（最多20份），按该按钮的时间间隔不能超过一秒。</p><p>按钮3：在A4尺寸的普通纸上开始彩色复印。 说明：要增加复印份数（最多20份），按该按钮的时间间隔不能超过一秒。</p><p>按钮4：停止当前操作。 说明：按下此按钮三秒，直到“按钮1”闪烁，开始运行打印头清洗程序。</p><p><img src="'+A+'" alt=""> 扩展资料</p><p>爱普生L380打印机的按钮组合功能：</p><p>1、同时按“按钮2”和“按钮3”可在USB连接的计算机上运行软件并扫描为PDF文档。</p><p>2、同时按“按钮2”和“按钮4”或同时按“按钮3”和“按钮4”可在草稿模式下复印。</p><p>3、按住“按钮4”再按“按钮1”可打印喷嘴检查图案。</p><p>另外，爱普生L380打印机还提供两个功能指示灯，如上图5和6，作用是：</p><p>1、指示灯5：当打印纸用完或出现夹纸时亮起或闪烁。</p><p>2、指示灯6：表示首次充墨的状态。</p><h2 id="驱动下载" tabindex="-1">驱动下载 <a class="header-anchor" href="#驱动下载" aria-label="Permalink to &quot;驱动下载&quot;">​</a></h2><p>如果你要连接电脑，必须要下载驱动，不然电脑识别不了</p><p><a href="https://www.epson.com.cn/services/supportproduct.html?p=132230e27e4240d9b06182ba6013c942" target="_blank" rel="noreferrer">官网下载地址</a></p><p>需要下载两个，一个打印驱动，一个复印驱动。 <img src="'+d+'" alt=""></p><p>电脑识别到打印机 <img src="'+l+'" alt=""><img src="'+h+'" alt=""> 扫描识别 <img src="'+m+'" alt=""></p>',24);function f(g,q,L,Z,H,b){const a=c("AdUnitForInArticle");return o(),s("div",null,[P,n(a,{"data-ad-slot":4594918104}),Q])}const T=t(E,[["render",f]]);export{B as __pageData,T as default};
